			var coordsMLS = élément.geometry.coordinates;
			let coordsMLSTurf = turf.multiLineString(coordsMLS);
			let coordsMLSRev = turf.flip(coordsMLSTurf);
			coordsMLS = coordsMLSRev.geometry.coordinates;
			var élémentsMLS = L.polyline(coordsMLS, {color: élément.properties.couleur, nomCoucheMLSEtCouleur:élément.properties.nomcouche.concat(élément.properties.couleur)});

			else {
				élémentsMLS.bindPopup(tabPopupLegMLS.join("<br />"), {maxWidth: 400, closeOnClick:true});
			}	
		}			
	
		if (élément.properties.couleur && élément.properties.legende && élément.geometry.type == "MultiPolygon"){
			for (var nomPpté in élément.properties) {	
				if (nomPpté.match(/^([Nn]uméro [Rr]oute|[Nn]umeroroute|[Rr][Dd])$/)) {
					tabPopupLegMP.unshift("<b>"+ nomPpté + ":</b> " + élément.properties[nomPpté]);	
				} 
				else {
					if (!nomPpté.match(/^([Cc]ouleur|[Ll]egende|[Ii]cone|to_timestamp|nomcouche|afficherlegouverture|leafletsearch)$/)) {

					}
					if (!nomPpté.match(/^([Cc]ouleur|[Ll]egende|[Ll]ien|[Ii]cone|to_timestamp|nomcouche|afficherlegouverture|leafletsearch)/)){
						tabTooltipLegMP.push("<b>"+ nomPpté + ":</b> " + élément.properties[nomPpté]);
					}
				}	
			}
			var coordsMP = élément.geometry.coordinates;
			let coordsMPTurf = turf.multiPolygon(coordsMP);
			let coordsMPREv = turf.flip(coordsMPTurf);
			coordsMP = coordsMPREv.geometry.coordinates;
			var coucheMP = L.polygon(coordsMP, {color: élément.properties.couleur, nomCoucheMPEtCouleur:élément.properties.nomcouche.concat(élément.properties.couleur), fill:true});

			}
			else {
				coucheMP.bindPopup(tabPopupLegMP.join("<br />"), {maxWidth: 400, closeOnClick:true});		
			}
		}
	}

	this.ajouterLogo = function() {
    var logoControl = null;  
    function creerLogo(icones, maCarte) {
        if (logoControl) {
            maCarte.removeControl(logoControl);
        }
        L.Control.Logos = L.Control.extend({
            onAdd: function(map) {
                var container = L.DomUtil.create("div", "leaflet-bar leaflet-control");
                container.style.display = "flex";
                container.style.flexDirection = "row";
                container.style.background = "none";
                container.style.border = "none";
                
                icones.forEach(function(icone) {
                    var img = L.DomUtil.create("img", "", container);
                    img.src = icone.imgSource;
                    img.style.width = icone.largeur;
                    img.style.height = icone.hauteur;
                    img.title = icone.imgTooltip;
                    img.style.marginRight = "5px";
                    img.style.marginLeft = icone.marginLeft;    
                    img.style.cursor = "pointer";
                    
                    img.onclick = function(e) {
                        e.preventDefault();
                        window.open(icone.lienSite, icone.typeLien);
                    };
                });
                return container;
            }
        });
        logoControl = new L.Control.Logos({ position: "bottomleft" });
        logoControl.addTo(maCarte);
    }

    // Fonction pour choisir les bonnes icônes selon le contexte
    function updateLogos() {
        var icones = [];        
        if (maCarte.hasLayer(orthoIGN) || maCarte.hasLayer(googleSat)) {
            icones = [
                {imgSource: "/Ressources/c3po-blanc.png", largeur: "66px", hauteur: "60px", imgTooltip: "Accueil si3p0", lienSite: "/", typeLien: "_self"},
                {imgSource: "/Ressources/backward-blanc.png", marginLeft: "10px", largeur: "42px", imgTooltip: "Page précedente", lienSite: "javascript:history.back()", typeLien: "_self"}
            ];
        } else {
            icones = [
                {imgSource: "/Ressources/c3po_gr.png", largeur: "66px", hauteur: "60px", imgTooltip: "Accueil si3p0", lienSite: "/", typeLien: "_self"},
                {imgSource: "/Ressources/backward.png", marginLeft: "10px", largeur: "42px", imgTooltip: "Page précedente", lienSite: "javascript:history.back()", typeLien: "_self"}
            ];
        }

        if (valeurTitre1.endsWith("Waze")){

	this.rechercherJson = function(){	
	 if (strRechJson!=="false"){
		var tabRechJson = [];
		tabRechJson = strRechJson.split("|");
		//console.log("tabRechJson: " + tabRechJson);
		// gestion passage param incomplet
		if (tabRechJson.length < 5){
			tabRechJson[2] = " ";
			tabRechJson[3] = " ";
			tabRechJson.push("objet métier") ;
		}
		var numRechCouche = tabRechJson[0]-1;		
		coucheJson = tabCoucheMG[numRechCouche];
		var colRechJson = tabRechJson[1];	
		var libelleRechJson = tabRechJson[4];
		
		var ctrlRechJson = new L.Control.Search({
			layer: coucheJson,
			propertyName:colRechJson,
			initial:false,
			firstTipSubmit:true,
			buildTip: function(text,val) {				
				var colDescr1, colDescr2 = "";
				colDescr1 = tabRechJson[2];
				colDescr2 = tabRechJson[3];
				descr1 = val.layer.feature.properties[colDescr1];	
				descr2 = val.layer.feature.properties[colDescr2];
				if (descr1&&descr2){
					return '<a href="#"><b style="color: blue";>'+text+'</b> - '+descr1+' - '+descr2+'</a>';
					}
					else if (descr1){
						return '<a href="#"><b style="color: blue";>'+text+'</b> - '+descr1+'</a>';
					}
					else {
						return'<a href="#"><b style="color: blue";>'+text+'</b></a>';
					}
			},			
			textPlaceholder:'Rech. '+libelleRechJson,
			//collapsed:false,
			marker: false,
			position:"topright",
			zoom:16,
			moveToLocation: function(latlng, title, maCarte) {
				if (tabNettoyé[numRechCouche][0] === 'Point') {
				maCarte.setView(latlng, 16); 
				} else {
					var zoom = maCarte.getBoundsZoom(latlng.layer.getBounds());
					maCarte.setView(latlng, zoom);
				}
			}	
		});

		ctrlRechJson.on("search:locationfound", function(e) {		
		if (tabNettoyé[numRechCouche][0] !== 'Point'){
			e.layer.setStyle({fillColor: "#3f0", color: "#0f0"});
		}		
		if (e.layer._popup)
			coucheJson.addTo(maCarte);
			e.layer.openPopup();
		}).on("search:collapsed", function(e) {
			coucheJson.eachLayer(function(layer) {
				coucheJson.resetStyle(layer);
				});
				coucheJson.remove(maCarte);
			});	
			
		ctrlRechJson.addTo(maCarte);
		
		// hover
		const searchButton = document.querySelector('.leaflet-control-search .search-button');
		let isOpen = false;
		
		ajouterHoverEtClic(searchButton, {
		    isVisible: () => document.querySelector('.leaflet-control-search.search-exp') !== null,
		    afficher: () => {
		        if (!isOpen) {
		            ctrlRechJson.expand();
		        }
		    },
		    masquer: () => {
		        if (!isOpen) {
		            ctrlRechJson.collapse();
		        }
		    },
		    onClose: (callback) => {
		        searchButton.addEventListener('click', () => {
		            isOpen = !isOpen;
		        });
		        ctrlRechJson.on('search:collapsed', () => {
		            isOpen = false;
		            callback();
		        });
		    }
		});		
	 }
	}		
}
